import React from "react";

function Detailscard() {
  return (
    <>
      <div>
        <div class="container">
          <div class="row">
            <div class="col-md-6">Column 1</div>
            Column 2
          </div>
        </div>
        <div class="row">
          <div class="col-md-4">Column 1</div>
          <div class="col-md-4">Column 2</div>
        </div>
      </div>
    </>
  );
}

export default Detailscard;
